import React from "react";
import { Row } from "react-bootstrap";
import Navigation from "../Component/Navigation";

const Acount = () => {
    return(
        <>
        <Row><Navigation/></Row>
        <Row className="mt-4 mb-5"> <button className="btn btn-outline-dark">Logout</button></Row>
        </>
    )
}
export default Acount
